import React from "react";
import { BrowserRouter as Router, NavLink } from "react-router-dom";

import "./Header.css";

const Header = ({ userData, setRedirect, setUser }) => {
  if (userData.username === "") {
    console.log("SETTING USER");
    setUser();
  }
  return (
    <>
      <div className="header">
        <div className="logo">
          <h1>A Musical Planet</h1>
        </div>
        <div className="navbar">
          <NavLink className="linkButton" to="/maps" replace>
            Maps
          </NavLink>
          <NavLink className="linkButton" to="/maps" replace>
            About
          </NavLink>
          <NavLink className="linkButton" to="/maps" replace>
            Leaderboard
          </NavLink>
          {userData.username ? (
            <NavLink className="linkButton" to="/maps" replace>
              {userData.username}
            </NavLink>
          ) : (
            <></>
          )}
        </div>
      </div>
    </>
  );
};

export default Header;
